<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8" />
  <title>Million Tile Video Wall</title>
  <meta name="viewport" content="width=device-width, initial-scale=1.0" />
  <style>
    html, body {
      margin: 0;
      height: 100%;
      overflow: hidden;
      background: #000;
      font-family: sans-serif;
      color: white;
    }

    #viewport {
      width: 100vw;
      height: 100vh;
      overflow: auto;
      position: relative;
    }

    #grid {
      position: relative;
      width: 160000px; /* 1000 x 160px */
      height: 90000px;  /* 1000 x 90px */
    }

    .tile {
      position: absolute;
      width: 160px;
      height: 90px;
      background: #222;
      overflow: hidden;
      cursor: pointer;
    }

    .tile img {
      width: 100%;
      height: 100%;
      object-fit: cover;
      object-position: center;
    }

    .iframe-container {
      width: 100%;
      height: 100%;
    }

    .iframe-container iframe {
      width: 100%;
      height: 100%;
      border: none;
    }

    .tile-number {
      position: absolute;
      top: 0;
      left: 0;
      width: 100%;
      height: 20px;
      background: rgba(0, 0, 0, 0.7);
      color: white;
      text-align: center;
      line-height: 20px;
      font-size: 12px;
      opacity: 1; /* Always visible */
      transition: opacity 0.3s ease;
    }

    .tile:hover .tile-number {
      opacity: 1;
    }
  </style>
</head>

    const visibleTiles = {};

    function renderTiles() {
      const scrollLeft = viewport.scrollLeft;
      const scrollTop = viewport.scrollTop;
      const viewportWidth = viewport.clientWidth;
      const viewportHeight = viewport.clientHeight;

      const startCol = Math.floor(scrollLeft / TILE_WIDTH);
      const endCol = Math.min(GRID_COLS, Math.ceil((scrollLeft + viewportWidth) / TILE_WIDTH));
      const startRow = Math.floor(scrollTop / TILE_HEIGHT);
      const endRow = Math.min(GRID_ROWS, Math.ceil((scrollTop + viewportHeight) / TILE_HEIGHT));

      const newVisible = {};

      for (let row = startRow; row < endRow; row++) {
        for (let col = startCol; col < endCol; col++) {
          const key = `${row}_${col}`;
          newVisible[key] = true;
          if (!visibleTiles[key]) {
            const youtubeId = sampleVideos[(row * GRID_COLS + col) % sampleVideos.length];

            const tile = document.createElement("div");
            tile.className = "tile";
            tile.style.top = `${row * TILE_HEIGHT}px`;
            tile.style.left = `${col * TILE_WIDTH}px`;

            const img = document.createElement("img");
            img.src = `https://img.youtube.com/vi/${youtubeId}/hqdefault.jpg`;
            img.alt = `Tile ${row}, ${col}`;
            tile.appendChild(img);

            const tileNumber = document.createElement("div");
            tileNumber.className = "tile-number";
            tileNumber.textContent = (row * GRID_COLS + col) + 1;
            tile.appendChild(tileNumber);

            tile.addEventListener("click", () => {
              tile.innerHTML = `
                <div class="iframe-container">
                  <iframe
                    src="https://www.youtube.com/embed/${youtubeId}?autoplay=1&mute=1"
                    allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
                    allowfullscreen
                  ></iframe>
                </div>`;
            });

            grid.appendChild(tile);
            visibleTiles[key] = tile;
          }
        }
      }

      for (let key in visibleTiles) {
        if (!newVisible[key]) {
          grid.removeChild(visibleTiles[key]);
          delete visibleTiles[key];
        }
      }
    }

    renderTiles();
    viewport.addEventListener("scroll", () => {
      requestAnimationFrame(renderTiles);
    });
  </script>
